Onderstel dat die radius van die groter sirkel $r$ is. Dan is die oppervlakte van die groter sirkel $\pi r^2$ en die oppervlakte van die gekeurd gebied $\frac5{12}\pi r^2$. Die oppervlakte van die gekeurd gebied is die som van die oppervlakte van die twee sirkels en die oppervlakte van die ongekeurd gebied. Die oppervlakte van die groter sirkel is die som van die oppervlakte van die ongekeurd gebied en die oppervlakte van die ongekeurd gebied. Dus is die oppervlakte van die groter sirkel $\frac5{12}\pi r^2+\pi r^2=\frac{17}{12}\pi r^2$. Deur die oppervlakte van die groter sirkel te bereken, is $r=\sqrt{\frac{12}{17}}$. Deur die stelling van Pythagoras te toepassing, is die oppervlakte van die ongekeurd gebied $1^2+2^2-\left(\sqrt{\frac{12}{17}}\right)^2=\frac{29}{17}$. Deur die oppervlakte van die ongekeurd gebied te bereken, is die hoek $ADC$ gelijk aan $\arccos\left(\frac{1}{\sqrt{\frac{29}{17}}}\right)=\arccos\left(\sqrt{\frac{17}{29}}\right)\approx53,1301^\circ$. Deur die hoek in gradie te omreken, is die hoek ongeveer $53^\circ$.  \[
\boxed{53^\circ}
\]

We know that the sum of an arithmetic sequence is equal to the average of the first and last term, multiplied by the number of terms.  So, we have $27a + \frac{27 \cdot 26}{2}d = 3^7$, where $a$ is the first term and $d$ is the common difference.  We want to find the median, which is the 14th term, or $a + 13d$.  We can solve for $a + 13d$ by multiplying the first equation by 13 and subtracting the second equation from it: \begin{align*}
13(27a + \frac{27 \cdot 26}{2}d) - (27a + \frac{27 \cdot 26}{2}d) &= 13 \cdot 3^7 - 3^7 \\
12(27a + \frac{27 \cdot 26}{2}d) &= 12 \cdot 3^7 \\
27a + \frac{27 \cdot 26}{2}d &= 3^7 \\
a + 13d &= \boxed{27}.
\end{align*}

